import React,{Component} from 'react'
import{
    NavBar,
    WingBlank,
    List,
    InputItem,
    WhiteSpace,
    Radio,
    Button
} from 'antd-mobile'
import Logo from '../../components/logo/logo'
export default class Register extends Component{
    constructor(props){

    }
    state={
        username:'',
        password:'',
        password2:'',
        type:'employee'
    }
    handleChange=(name,value)=>{
        this.setState({
            [name]:value
        })
    }
    toLogin=()=>{
        this.props.history.replace('/login');
    }
    render(){
        const {type} = this.state;
        return(
            <div>
                <NavBar>Hiring management</NavBar>
                <Logo />
                <WingBlank>
                    <List>
                        <InputItem placeholder="Please input username" onChange={this.handleChange}>
                        </InputItem>
                    </List>
                </WingBlank>
                <div>Register</div>
            </div>
        )
    }
}
